import React from 'react';
import "./TimeLine.css";
import Share from '../share/Share';
import Post from '../post/Post';
import {Posts} from "../../dummyDate";

export default function TimeLine() {
	return (
	<div className='timeline'>
		<div className="timelineWrapper">
			<Share />
			{Posts.map((post) => (
				<Post post/>
			))}

		</div>
	</div>
	);
}
